  constructor(props) {
    super(props); // for access to state

    this.state = {
      collections: Shop_Data,
    };
  }

  render() {
    const { collections } = this.stat;
    return (<div className='shop-page'>
    {
        collections.map(({id,...otherColl}) =>(
